            {
                cartDesc.map((item,index) => (
                   <div key={index} style={{ height: 160, width: "100%", marginTop: 5, justifyContent: "space-between", paddingHorizontal: 10, backgroundColor: "yellow", flexDirection: 'row', alignItems: 'center' }}>
